import React, { useState } from 'react'
import './Buyorsell.css';


const Buyorsell = () => {
  const [Isbuy, setIsbuy] = useState(true);

  const Onclick=()=>{
   if(Isbuy==true)
   setIsbuy(false);
   else
   setIsbuy(true);

  }
  return (
    
    <div id='buyorsell'>
        <div className='buyorsell'>
             <ul>
                <li className={Isbuy==true?"active":""} onClick={Onclick}>
                    Buy
                </li>
                <li className={Isbuy!=true?"active":""} onClick={Onclick}>
                    Sell
                </li>
             </ul>
        </div>
    </div>
  )
}

export default Buyorsell
